    value: 'Amended statement of organization to 11/03/1997 report:  The National
      Community Action Foundation'
  - name: AMENDED CD
    number: '5'
    value: ' Inc. and Affiliate (the Foundation) consists of two entities'
  - value: ' the National Community Action Foundation'
  - value: ' Inc. (NCAF) and Community Action Program Political Action Committee (CAP-PAC).  NCAF
      is a not-for-profit corporation organized under the Nonprofit Corporation Act
      of the District of Columbia.  NCAF was established by Community Action Agencies
      throughout the United States to lobby for legislation that represents the needs
      of low-income citizens.  Approximately 70 percent of the Foundation''s revenue
      is support from these Community Action Agencies and their members.  The Community
      Action Agencies are dependent in part on funding from the federal government.  The
      success of NCAF is dependent on the financial status of these agencies and their
      continued satisfaction with NCAF''s programs.  CAP-PAC is a political action
      committee that is affiliated with NCAF.  Operational and administrative costs
      of CAP-PAC'
  - value: ' unrelated to its political action activities'
  - value: ' are paid for by NCAF.  CAP-PAC is under the common control of NCAF''s
      Board of Directors.'
